import Layout from '../components/Layout'
import { Container, Row, Col } from 'reactstrap'
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome'
import { faCoffee } from '@fortawesome/free-solid-svg-icons'
import { faCannabis } from '@fortawesome/free-solid-svg-icons'
import { faJoint } from '@fortawesome/free-solid-svg-icons'
import { faBong } from '@fortawesome/free-solid-svg-icons'



const Index = () => (
    <Layout>
        <>
            <Container>
                <Row>
                    <h1>The Menu</h1>
                    <div id="icons">
                        <Col>
                            <div id="coffee">
                                <button type="button" className="btn btn-success" id="btn-weed"><FontAwesomeIcon icon={faCoffee} height="150px" width="150px" /></button>
                            </div>
                        </Col>

                        <Col>
                            <div id="cannabis">
                                <button type="button" className="btn btn-success" id="btn-weed"><FontAwesomeIcon icon={faCannabis} height="150px" width="150px" /></button>
                            </div>
                        </Col>

                        <Col>
                            <div id="joint">
                                <button type="button" className="btn btn-success" id="btn-weed"><FontAwesomeIcon icon={faJoint} height="150px" width="150px" /></button>
                            </div>
                        </Col>

                        <Col>
                            <div id="bong">
                                <br />
                                <button type="button" className="btn btn-success" id="btn-weed"> <FontAwesomeIcon icon={faBong} height="150px" width="150px" /></button>
                            </div>
                        </Col>
                        <br />
                        <br />
                    </div>
                </Row>
            </Container>
            <style jsx>
                {`


               h1 {
                   text-align: center;
                   margin-top: 10px;
                   text-decoration: underline;
               }
               #coffee {
                   color: brown;

                   margin-left: 15px;


               }
               #cannabis {
                   color: green;

                   margin-left: 15px;

               }
               #joint {
                   color: brown;

                   margin-left: 15px;

               }
               #bong{

                margin-left: 15px;
                color: blue;

               } 
               #btn-weed {
                   display: flex;
                   margin-left: 35px;
                   margin-top: 5px;
                   margin-bottom: 3px;
               }

               `}
            </style>
        </>
    </Layout>
)

export default Index;
